import { Box, Typography } from "@mui/material";

const Header = () => {
  return (
    <Box>
      <Box display="flex" height="50px" bgcolor="#252F3D">
        <Box display="flex">
          <img
            alt="checkmark"
            src="checkmark.png"
            style={{ width: "22px", height: "22px" }}
          />
          <Typography fontSize="12px">30-DAY SATISFACTION GUARANTEE</Typography>
        </Box>
      </Box>
      <Box display="flex" justifyContent="space-between">
        <img alt="clarifion-logo" src="clarifion-logo.png" />
        <Box>
          <img alt="mcafee-logo" src="mcafee.png" />
          <img alt="norton-logo" src="norton.png" />
        </Box>
      </Box>
      <Typography>Wait ! your order in progress.</Typography>
      <Typography>
        Lorem ipsum dolor sit amet, consectetur adipiscing
      </Typography>
    </Box>
  );
};

export default Header;
